  //         url={planets.url}
  //       />
  //     ))}
  //   </ul>
  // );

  const { planets, currentPageIndex } = props;
  
  if (!planets || planets.length === 0) {
    return <p>No planets to display.</p>;
  }

  const currentPlanet = planets[currentPageIndex];

  return (
    <ul className={style["planets-list"]}>
      <Planet
        key={currentPlanet.id}
        name={currentPlanet.id}
        imageSrc={currentPlanet.imageSrc}
        description={currentPlanet.description}
        climate={currentPlanet.climate}
        terrain={currentPlanet.terrain}
        population={currentPlanet.population}
        diameter={currentPlanet.diameter}
        gravity={currentPlanet.gravity}
        rotationPeriod={currentPlanet.rotationPeriod}
        orbitalPeriod={currentPlanet.orbitalPeriod}
        surfaceWater={currentPlanet.surfaceWater}
        created={currentPlanet.created}
        edited={currentPlanet.edited}
        url={currentPlanet.url}
      />
    </ul>
  );
};

export default PlanetList;
